E_D("replace into `phome_ecms_game` values('13340','19','0','','','','1','admin','','1','0','1346119788','0','0','0','0','','','13340','0','0','0','0','0','0','放屁风波','1346119788','/spic/20120725/4362.jpg','0','1','1346119788','0','3','1','0','','0','','/d/file/swf/024.swf','667','479','米头是碧玄最好的饿朋友，平常他每天都会到吴婆婆的蛋糕铺里去。可是现在不知道为什么，已经一连三天他都没有找碧玄玩了。','1','','0','','1','/dpic/20120725/4363.jpg','10126','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA1VE9IZE5hbEYxWXpOa2JRPT0=','0','0','http://s.61baobao.com/common/flash/2011b/05/024.swf','http://www.61baobao.com/common/flash/2011b/05/dpic/024.jpg','http://www.61baobao.com/common/flash/2011b/05/pic/024.jpg','0','三个月以上','0','','0','','0','0','0');");
