E_D("replace into `phome_ecms_game` values('13342','19','0','','','','1','admin','','1','0','1346119792','0','0','0','0','','','13342','0','0','0','0','0','0','做蛋糕','1346119792','/spic/20120725/4410.jpg','0','1','1346119792','0','3','1','0','','0','','/d/file/swf/004.swf','667','479','数千万年前 宇宙中的智慧生命五面怪在宇宙中建造了一个星球--赛博特恩（cybertron），在这个星球上，五面怪建造了方便自己制造的星球核心计算机--魔力神球。并在这个星球上制造了两条生产线--军用和民用。这两条生产线上出产的机器人就是后来变形金刚的祖先。魔力神球在五面怪的程序下是个没有思想，没有正邪的设备，同样的它的能力无法超过五面怪，不能自己制造机器人，但可以运行五面怪的程序赋予完整的机体以自主意识程序。','1','','0','','1','/dpic/20120725/4411.jpg','10106','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA1VE9IZE5SRkYxWXpOa2JRPT0=','0','0','http://s.61baobao.com/common/flash/2011b/05/004.swf','http://www.61baobao.com/common/flash/2011b/05/dpic/004.jpg','http://www.61baobao.com/common/flash/2011b/05/pic/004.jpg','0','三个月以上','0','','0','','0','0','0');");
