E_D("replace into `phome_ecms_game` values('13351','19','0','','','','1','admin','','1','0','1346119813','0','0','0','0','','','13351','0','0','0','0','0','0','獾貂争肉','1346119813','/spic/20120725/4372.jpg','0','1','1346119813','0','3','1','0','','0','','/d/file/swf/022.swf','667','479','有一天，一只獾和一只貂同时在森林的小路上发现了一块肉。<br />“这是我捡到的。”獾叫喊说。<br />“不，是我捡到的。”貂也叫喊起来。<br />“是我先看见的。”獾发火了。<br />“不对，是我第一个发现的。”貂争抢着说。<br />他们争执不下，难解难分。这时，獾说话了：“这样吧，我们去找狐狸法官，请他给咱们评评理。”','1','','0','','1','/dpic/20120725/4373.jpg','10124','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA1VE9IZE5ha2wxWXpOa2JRPT0=','0','0','http://s.61baobao.com/common/flash/2011b/05/022.swf','http://www.61baobao.com/common/flash/2011b/05/dpic/022.jpg','http://www.61baobao.com/common/flash/2011b/05/pic/022.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('13352','19','0','','','','1','admin','','1','0','1346119816','0','0','0','0','','','13352','0','0','0','0','0','0','白雪公主','1346119816','/spic/20120725/4428.jpg','0','1','1346119816','0','3','1','0','','0','','/d/file/swf/baixuegongzhu.swf','667','479','小破孩天天有话想对小丫说，就是说不出来，真窝囊！三八妇女节这天，终于大胆地行动了……破孩奉劝朋友们，趁着三八节，都别藏着掖着了。','1','','0','','1','/dpic/20120725/4429.jpg','9143','VEROd01Fd3pSbkJpYlVwb1luazVhVmxYYkRSa1YxWnVZakkxYm1WdGFERk1iazR6V21jOVBRPT0=','0','0','http://s.61baobao.com/zt/qinbao/baixuegongzhu.swf','http://www.61baobao.com/zt/qinbao/dpic/baixuegongzhu.jpg','http://www.61baobao.com/zt/qinbao/pic/baixuegongzhu.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('13353','19','0','','','','1','admin','','1','0','1346119816','0','0','0','0','','','13353','0','0','0','0','0','0','蝙蝠、荆棘和潜水鸟','1346119816','/spic/20120725/4380.jpg','0','1','1346119816','0','3','1','0','','0','','/d/file/swf/021.swf','667','479','蝙蝠、荆棘、潜水鸟，决定合伙经商。 <br />蝙蝠借了银子入股，荆棘投进自己的衣服，潜水鸟则买了铜投资，然后它们便乘船出发了。 <br />后来遇上大风，船被吹翻，货物全部丧失，它们漂到岸上才得救。 <br />从此以后，潜水鸟为了找铜，钻到水底的深处，总想什么时候可以把铜找回来； <br />蝙蝠怕见债主，白天不敢露面，夜里才出来觅食； <br />荆棘为了寻找自己的衣服，谁从旁边经过，它就把谁的衣服抓住，想要认出自己的衣服来','1','','0','','1','/dpic/20120725/4381.jpg','10123','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA1VE9IZE5ha1YxWXpOa2JRPT0=','0','0','http://s.61baobao.com/common/flash/2011b/05/021.swf','http://www.61baobao.com/common/flash/2011b/05/dpic/021.jpg','http://www.61baobao.com/common/flash/2011b/05/pic/021.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('13354','19','0','','','','1','admin','','1','0','1346119820','0','0','0','0','','','13354','0','0','0','0','0','0','嘟嘟鸭星球','1346119820','/spic/20120725/4384.jpg','0','1','1346119820','0','3','1','0','','0','','/d/file/swf/020.swf','667','479','在太空里有一个嘟嘟鸭星球，这里没有污染，很多嘟嘟鸭就生活在这里。可是有一天，天上出现了一只很大的飞船，停在了嘟嘟鸭星球上。从飞船上走下来一些外星鹅。他们是一些仰着头，显得很神气的外星鹅。然后故事就这样开始了...','1','','0','','1','/dpic/20120725/4385.jpg','10122','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA1VE9IZE5ha0YxWXpOa2JRPT0=','0','0','http://s.61baobao.com/common/flash/2011b/05/020.swf','http://www.61baobao.com/common/flash/2011b/05/dpic/020.jpg','http://www.61baobao.com/common/flash/2011b/05/pic/020.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('13355','19','0','','','','1','admin','','1','0','1346119822','0','0','0','0','','','13355','0','0','0','0','0','0','面条烫头记','1346119822','/spic/20120725/4426.jpg','0','1','1346119822','0','3','1','0','','0','','/d/file/swf/010.swf','667','479','有一天，面条和馒头打架。可是馒头打输了，面条很高兴。在那里哈哈大笑。 于是馒头找来了面团去找面条。馒头在外面大喊“面条你给我滚出来，”可是 ...','1','','0','','1','/dpic/20120725/4427.jpg','10112','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA1VE9IZE5WRUYxWXpOa2JRPT0=','0','0','http://s.61baobao.com/common/flash/2011b/05/010.swf','http://www.61baobao.com/common/flash/2011b/05/dpic/010.jpg','http://www.61baobao.com/common/flash/2011b/05/pic/010.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('13356','19','0','','','','1','admin','','1','0','1346119830','0','0','0','0','','','13356','0','0','0','0','0','0','小破孩-三八','1346119830','/spic/20120725/4432.jpg','0','1','1346119830','0','3','1','0','','0','','/d/file/swf/029.swf','667','479','童故事是开启儿童智慧大门的一把钥匙。听故事可以丰富儿童知识，同时提升思维能力和想象能力，促进儿童的思维更加细微准确，想象更加斑斓、开阔。快来亲宝网和我们一起听好听的故事吧！','1','','0','','1','/dpic/20120725/4433.jpg','9089','VEhwTmRVMURPSGxOZVRoM1RXcHJkV016WkcwPQ==','0','0','http://s.61baobao.com/3.0/23/029.swf','http://www.61baobao.com/3.0/23/dpic/029.jpg','http://www.61baobao.com/3.0/23/pic/029.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('13357','19','0','','','','1','admin','','1','0','1346119832','0','0','0','0','','','13357','0','0','0','0','0','0','会说好话的小老鼠','1346119832','/spic/20120725/4388.jpg','0','1','1346119832','0','3','1','0','','0','','/d/file/swf/019.swf','667','479','有一天，一个小男孩说了一句脏话，这脏话就到了地上，变成了一个丑话人：一个眼睛，半个鼻孔，两个短胳膊，两条细细的腿，头发乱蓬蓬的，一张大大的嘴。小老鼠去商店去买东西，听见了丑话人在哭......','1','','0','','1','/dpic/20120725/4389.jpg','10121','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA1VE9IZE5WR3QxWXpOa2JRPT0=','0','0','http://s.61baobao.com/common/flash/2011b/05/019.swf','http://www.61baobao.com/common/flash/2011b/05/dpic/019.jpg','http://www.61baobao.com/common/flash/2011b/05/pic/019.jpg','0','三个月以上','0','','0','','0','0','0');");
