E_D("replace into `phome_ecms_game` values('13360','19','0','','','','1','admin','','1','0','1346119846','0','0','0','0','','','13360','0','0','0','0','0','0','鸟类的家','1346119846','/spic/20120725/4434.jpg','0','1','1346119846','0','3','1','0','','0','','/d/file/swf/008.swf','667','479','鸟类的家鸟类的家儿童百科： 鸟和人一样需要有一个温暖的家，但是不同的鸟家的样子也不一样，比如燕子的家和麻雀的家是不一样的。让我们一起来认识他们吧。','1','','0','','1','/dpic/20120725/4435.jpg','10110','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA1VE9IZE5SR2QxWXpOa2JRPT0=','0','0','http://s.61baobao.com/common/flash/2011b/05/008.swf','http://www.61baobao.com/common/flash/2011b/05/dpic/008.jpg','http://www.61baobao.com/common/flash/2011b/05/pic/008.jpg','0','三个月以上','0','','0','','0','0','0');");
