E_D("replace into `phome_ecms_game` values('13365','19','0','','','','1','admin','','1','0','1346119871','0','0','0','0','','','13365','0','0','0','0','0','0','小猫咪','1346119871','/spic/20120725/4442.jpg','0','1','1346119871','0','3','1','0','','0','','/d/file/swf/045.swf','667','479','一天中午小貓回家貓妈妈倒好了一盆水叫小貓咪洗澡小貓说：“不！我不洗！”<br />小貓又出去玩，它玩了一身的泥巴，变成了一只小黑猫。<br />小貓玩累了，它躺在地上休息；忽然，三只小老鼠看见了小猫，以为是一个大面包，忍不住直流口水，老鼠说：“我们把它抬到洞里，说不定能吃上三天三夜呢！”三只老鼠忍不住吃了几口把小猫身上的泥壳咬掉了。一只老鼠踩了小猫一脚，小猫痛得“喵！喵！”直叫，三只老鼠吓得乱跑。','1','','0','','1','/dpic/20120725/4443.jpg','9073','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA5RE9IZE9SRlYxWXpOa2JRPT0=','0','0','http://s.61baobao.com/common/flash/2011b/08/045.swf','http://www.61baobao.com/3.0/23/dpic/013.jpg','http://www.61baobao.com/3.0/23/pic/013.jpg','0','三个月以上','0','','0','','0','0','0');");
