E_D("replace into `phome_ecms_game` values('13448','19','0','','','','1','admin','','1','0','1346120062','0','0','0','0','','','13448','0','0','0','0','0','0','小壁虎借尾巴','1346120062','/spic/20120725/5416.jpg','0','1','1346120062','0','3','1','0','','0','','/d/file/swf/6990.swf','667','479','小壁虎在墙角捉蚊子，一条蛇咬住了他的尾巴。小壁虎一挣，挣断尾巴逃走了。<br />    没有尾巴多难看哪！小壁虎想，向谁去借一条尾巴呢？<br />    它爬呀爬，爬到大树上。看见雄孔雀展开着漂亮的翅膀，小壁虎对孔雀说：“孔雀哥哥，您把尾巴借给我行吗？”孔雀说：“不行啊，我要用尾巴保护自己呢。”<br />    小壁虎爬呀爬，又爬到大树上，它看见剪刀鸟正在造窝，小壁虎说：“剪刀鸟哥哥，您把尾巴借给我行吗？”剪刀鸟说：“不行啊，我要用尾巴造窝呢。”<br />    小壁虎爬呀爬，爬到花坛前，看见萤火虫正在天空中玩耍，小壁虎说：“萤火虫哥哥，您把尾巴借给我行吗？”<br />萤火虫说：“对不起，我不能把尾巴借给你，因为我要用尾巴照亮呢。”<br />    小壁虎借不到尾巴，心里很难过。爬呀爬，爬回家里找妈妈。<br />   小壁虎把借尾巴的事告诉了妈妈，妈妈笑着说：“傻孩子，你转过身子看看。”小壁虎转身一看，高兴的叫了起来：“我长出一条新尾巴啦！”<br />','1','','0','','1','/dpic/20120725/5417.jpg','7825','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET1d0TWVsazFUMVJCZFdNelpHMD0=','0','0','http://s.61baobao.com/common/flash/d/6990.swf','http://www.61baobao.com/common/flash/d/dpic/6990.jpg','http://www.61baobao.com/common/flash/d/pic/6990.jpg','0','三个月以上','0','','0','','0','0','0');");
