E_D("replace into `phome_ecms_game` values('13461','19','0','','','','1','admin','','1','0','1346120104','0','0','0','0','','','13461','0','0','0','0','0','0','满腹牢骚的小猫','1346120104','/spic/20120725/5476.jpg','0','1','1346120104','0','3','1','0','','0','','/d/file/swf/050.swf','667','479','','1','','0','','1','/dpic/20120725/5477.jpg','7799','VEhwTmRVMURPSGRPVXpoM1RsUkJkV016WkcwPQ==','0','0','http://s.61baobao.com/3.0/05/050.swf','http://www.61baobao.com/3.0/05/dpic/050.jpg','http://www.61baobao.com/3.0/05/pic/050.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('13462','19','0','','','','1','admin','','1','0','1346120105','0','0','0','0','','','13462','0','0','0','0','0','0','狼来了','1346120105','/spic/20120725/5472.jpg','0','1','1346120105','0','3','1','0','','0','','/d/file/swf/044.swf','667','479','　从前，有个放羊娃，每天都去山上放羊。 　　一天，他觉得十分无聊，就想了个捉弄大家寻开心的主意。他向着山下正在种田的农夫们大声喊：“狼来了！狼来了！救命啊！”农夫们听到喊声急忙拿着锄头和镰刀往山上跑，他们边跑边喊：“不要怕，孩子，我们来帮你打恶狼！” 　　农夫们气喘吁吁地赶到山上一看，连狼的影子也没有！放羊娃哈哈大笑：“真有意思，你们上当了！”农夫们生气地走了。 　　第二天，放羊娃故伎重演，善良的农夫们又冲上来帮他打狼，可还是没有见到狼的影子。 　　放羊娃笑得直不起腰：“哈哈！你们又上当了！哈哈！” 　　大伙儿对放羊娃一而再再而三地说谎十分生气，从此再也不相信他的话了。 　　过了几天，狼真的来了，一下子闯进了羊群。放羊娃害怕极了，拼命地向农夫们喊：“狼来了！狼来了！快救命呀！狼真的来了！” 　　农夫们听到他的喊声，以为他又在说谎，大家都不理睬他，没有人去帮他，结果放羊娃的许多羊都被狼咬死了。 　　寓言的寓意： 　　1　说谎是一种不好的行为，它既不尊重别人，也会失去别人对自己的信任。 　　我们应该培养诚恳待人的良好品质。 　　2 说谎不能太单一，第一次说狼来了 第二次应该说着火了 第三次应该说有人落水了 谎言不可怕 谎言没人相信才可怕 　　3 不要反复使用同一个借口以达到自己的目的，终有一天，它会害了你。','1','','0','','1','/dpic/20120725/5473.jpg','7793','VEhwTmRVMURPSGRPVXpoM1RrUlJkV016WkcwPQ==','0','0','http://s.61baobao.com/3.0/05/044.swf','http://www.61baobao.com/3.0/05/dpic/044.jpg','http://www.61baobao.com/3.0/05/pic/044.jpg','0','三个月以上','0','','0','','0','0','0');");
