E_D("replace into `phome_ecms_game` values('13981','19','0','','','','1','admin','','1','0','1346120996','0','0','0','0','','','13981','0','0','0','0','0','0','FLASH迪士尼动画--美人鱼','1346120996','/spic/20120725/7111.gif','0','1','1346120996','0','3','1','0','','0','','/d/file/swf/4501.swf','667','479','','1','','0','','1','/dpic/20120725/7112.gif','4501','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET1d0TWVsRXhUVVJGZFdNelpHMD0=','0','0','http://s.61baobao.com/common/flash/d/4501.swf','http://www.61baobao.com/common/flash/d/dpic/4501.gif','http://www.61baobao.com/common/flash/d/pic/4501.gif','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('13982','19','0','','','','1','admin','','1','0','1346120997','0','0','0','0','','','13982','0','0','0','0','0','0','丑小鸭','1346120997','/spic/20120725/7081.gif','0','1','1346120997','0','3','1','0','','0','','/d/file/swf/4496.swf','667','479','在夏日阴凉的树阴下，鸭妈妈孵着鸭宝宝。小鸭子一个个破壳而出，只有那只最大的蛋还没有动静。鸭妈妈耐心地等着，终于，小家伙钻出来了，他又大又丑，和别的小鸭子很不一样。<br /><br />大家一见到他就叫起来：“瞧，他多丑啊！”有一只鸭子马上扑过来，狠狠啄了他一下。<br /><br />“别这样，”鸭妈妈说，“他并没有伤害谁呀！”<br /><br />“他是没有伤害别人，不过他长得这么大，这么丑，因此他必须挨打！”<br /><br />大家都不喜欢丑小鸭，连他的兄弟姐妹也说：“你这个丑八怪，真希望猫儿把你抓去才好！”<br /><br />丑小鸭很难过，他真想躲到一个别人看不见的地方。这天天黑的时候，他悄悄地离开了家，晚上睡在一片沼泽地里。天亮时，突然传来“砰砰”的枪响，整群的大雁从芦苇里飞出来，原来有猎人在打猎。一只猎狗跑了过来，把鼻子顶到他身上，凶巴巴地露出牙齿，丑小鸭吓得缩成一团，可是猎狗嗅了嗅，又跑开了。<br /><br />“啊，我丑得连猎狗也不咬我了！”丑小鸭悲伤地想。<br /><br />他来到一家农舍。农舍里住着一只小猫和一只母鸡。母鸡问：“你会生蛋吗？”丑小鸭摇摇头。母鸡得意地咯咯咯说：“这么重要的事你都不会做！”<br /><br />小猫问：“你会拱背吗？会喵唔喵唔叫吗？”丑小鸭又摇摇头。“那你会什么呢？”小猫轻蔑地问。丑小鸭想了想，说：“我会在水里游泳。”<br /><br />母鸡和小猫哈哈大笑，他们都看不起丑小鸭。不久，丑小鸭离开了他们。<br /><br />秋天来了，鸟儿们成群结队地飞往温暖的南方。一天，草丛中飞出一群白色的大鸟，细长的脖子，洁白的翅膀，他们是这样美丽，丑小鸭看得呆了，他不知道他们叫做天鹅，想想自己的样子，他真羡慕这些美丽幸福的鸟儿。<br /><br />冬天的天气越来越冷，水结冰了，丑小鸭和冰块冻在了一起。幸好有个农夫把他带回了家。他躲进厨房，可是不小心打翻了牛奶壶，牛奶泼得一地。农夫的妻子尖叫起来，丑小鸭吓坏了，看见大门敞开着，赶紧逃出了农夫的家。<br /><br />这个冬天寒冷又漫长，丑小鸭没有东西吃，也没有朋友。当冬天过去，春天终于来临的时候，丑小鸭忍不住想大哭一场。<br /><br />他拍拍翅膀，发现翅膀比以前有力得多，他试了两下，竟然可以飞起来了！他飞出沼泽，飞过森林，到了一个美丽的湖边，这时，他又看见了那群美丽的天鹅，正在水面上游来游去。<br /><br />','1','','0','','1','/dpic/20120725/7082.gif','4496','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET1d0TWVsRXdUMVJaZFdNelpHMD0=','0','0','http://s.61baobao.com/common/flash/d/4496.swf','http://www.61baobao.com/common/flash/d/dpic/4496.gif','http://www.61baobao.com/common/flash/d/pic/4496.gif','0','三个月以上','0','','0','','0','0','0');");
